import React from 'react';
import {Card,Image,Icon} from 'semantic-ui-react';

export default (props)=>{
	for(let i=0;i<this.props.showCount;i++){
		return(
			<Card>
				<Image />
				<Card.Content>
					<Card.Header> {this.props.shows[i].showName} </Card.Header>
					<Card.Meta> {`${this.props.shows[i].date} ${this.props.shows[i].fromTime} ${this.props.shows[i].toTime}`}</Card.Meta>
				</Card.Content>
				<Card.Content extra>
					<a>
						<Icon name='ethereum'/>
						{this.props.shows[i].amount} ether
					</a>
				</Card.Content>
			</Card>
		)
	}
}
